import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';

const AdminIdeaEditPage = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [idea, setIdea] = useState({ title: '', description: '', category: '', type: '' });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  useEffect(() => {
    let mounted = true;
    async function load() {
      setLoading(true);
      try {
        const API_ORIGIN = (process.env.REACT_APP_API_URL || 'http://localhost:5000').replace(/\/$/, '');
        const url = `${API_ORIGIN}/api/admin/ideas/${encodeURIComponent(id)}`;
        const token = localStorage.getItem('token');
        const { data } = await axios.get(url, { headers: { Authorization: token ? `Bearer ${token}` : undefined } });
        if (!mounted) return;
        const payload = data?.idea || data || {};
        setIdea({ title: payload.title || '', description: payload.description || '', category: payload.category || '', type: payload.type || '' });
      } catch (err) {
        setError(err?.response?.data?.message || err.message || 'Failed to load idea');
      } finally {
        if (mounted) setLoading(false);
      }
    }
    load();
    return () => { mounted = false; };
  }, [id]);

  const handleChange = (e) => setIdea(prev => ({ ...prev, [e.target.name]: e.target.value }));

  const handleSave = async () => {
    try {
      const API_ORIGIN = (process.env.REACT_APP_API_URL || 'http://localhost:5000').replace(/\/$/, '');
      const url = `${API_ORIGIN}/api/dashboard/ideas/${encodeURIComponent(id)}`; // README indicates user dashboard update route
      const token = localStorage.getItem('token');
      await axios.put(url, idea, { headers: { Authorization: token ? `Bearer ${token}` : undefined, 'Content-Type': 'application/json' } });
      navigate(-1);
    } catch (err) {
      setError(err?.response?.data?.message || err.message || 'Save failed');
    }
  };

  if (loading) return <div style={{padding: 24}}>Loading...</div>;
  if (error) return <div style={{padding: 24}}>Error: {error}</div>;

  return (
    <div style={{padding: 24}}>
      <button onClick={() => navigate(-1)} style={{marginBottom: 12}}>Back</button>
      <h2>Edit Idea</h2>
      <div style={{display: 'grid', gap: 12, maxWidth: 700}}>
        <input name="title" value={idea.title} onChange={handleChange} placeholder="Title" />
        <textarea name="description" value={idea.description} onChange={handleChange} placeholder="Description" rows={8} />
        <input name="category" value={idea.category} onChange={handleChange} placeholder="Category" />
        <select name="type" value={idea.type} onChange={handleChange}>
          <option value="">Select type</option>
          <option value="research">Research</option>
          <option value="project">Project</option>
        </select>
        <div>
          <button onClick={handleSave} style={{marginRight: 8}}>Save</button>
          <button onClick={() => navigate(-1)}>Cancel</button>
        </div>
      </div>
    </div>
  );
};

export default AdminIdeaEditPage;
